var refinedMounts = mounts.results.map( (mount) => ( {id: mount.data.id, name: mount.data.name.en_GB} ) )

var mountString = "[\n"

refinedMounts.forEach( element => mountString += ("MountItem(id: " + element.id + ", name: \"" + element.name +"\"),\n" ))

mountString = mountString.slice(0,mountString.length-2)

mountString += "\n]"

function exportMounts2txt() {

    const a = document.createElement("a");
    a.href = URL.createObjectURL(new Blob([mountString], {
        type: "text/plain"
    }));
    a.setAttribute("download", "mountsData.txt");
    document.body.appendChild(a);
    a.click();
    document.body.removeChild(a);
}

